#include<bits/stdc++.h>
using namespace std;

int dp[101][101];

bool f(int pile1, int pile2) {

    if(pile1 == 0 and pile2 == 0) {
        return dp[pile1][pile2] = false;
    }

    if(dp[pile1][pile2] != -1) {
        return dp[pile1][pile2];
    }

    bool ans = false;

    for(int i = 1; i <= pile1; ++i) {

        auto curAns = f(pile1 - i, pile2);
        if(curAns == false) {
            ans = true;
        }
    }

     for(int i = 1; i <= pile2; ++i) {

        auto curAns = f(pile1, pile2 - i);
        if(curAns == false) {
            ans = true;
        }
    }

    return dp[pile1][pile2] = ans;
}


int main() {

    memset(dp, -1, sizeof dp);
    int x; cin >> x;

    f(x, x);

    for(int i = 0; i <= x; ++i) {
        for(int j = 0; j <= x; ++j) {
            cout << dp[i][j] << " ";
        }

        cout << endl;
    }


}

